        year.push(year)

    }
    console.log(current_year);

    return (
        <>
            <FormLabel>西暦</FormLabel>
            <Select>
                <option>1期（冬期）</option>
                <option>2期（春期）</option>
                <option>3期（夏期）</option>
                <option>4期（秋期）</option>
            </Select>
        </>
    )
}

